pragma solidity ^0.4.24;

import "openzeppelin-solidity/contracts/ownership/Ownable.sol";
import "openzeppelin-solidity/contracts/math/SafeMath.sol";

import "./interfaces/IBetManager.sol";
import "./interfaces/ILeague.sol";
import "./interfaces/ILeagueRegistry.sol";
import "./interfaces/IResolver.sol";
import "./interfaces/IVault.sol";
import "./interfaces/IResolverRegistry.sol";

import "./utils/RegistryAccessible.sol";
import "./utils/ChainSpecifiable.sol";

import "./libraries/BetLib.sol";
import "./libraries/SignatureLib.sol";
import "./libraries/PositionLib.sol";

/**
 * @title Bet Manager Contract
 * @notice BetManager is the core contract responsible for bet validations and bet submissions
 */
contract BetManager is Ownable, IBetManager, RegistryAccessible, ChainSpecifiable {

  using SafeMath for uint;

  // Number of decimal places in BetLib.Odds
  uint public constant ODDS_DECIMALS = 4;

  // Oracle fee dividing factor (1 / 400 = 0.0025)
  uint public constant ORACLE_FEE = 400;

  // EIP712 Domain separator
  bytes32 public DOMAIN_SEPARATOR; // set during deploy time

  // Resolves to `true` if hash is used, `false` otherwise
  mapping(bytes32 => bool) private unclaimed;
  // Resolves to `true` if bet has been claimed, `false` otherwise
  mapping(bytes32 => bool) private claimed;
  // Position hash (layer, league, fixture, resolver, token) => Position
  mapping(bytes32 => PositionLib.Position) private positions;

  // Emit when a Bet has been submitted
  event LogBetSubmitted(
    bytes32 indexed _hash,
    address indexed _backer,
    address indexed _layer,
    address[3] _subjects,
    uint[4] _params,
    uint _nonce,
    bytes _payload
  );
  // Emit when a Bet has been claimed
  event LogBetClaimed(
    bytes32 indexed _hash,
    uint256 _result
  );
  // Emit when layer has claimed payout
  event LogPayoutClaimed(
    address indexed _layer,
    address _league,
    address _resolver,
    address _token,
    uint _fixture,
    bytes32 _segment
  );

  /**
   * @notice Constructor
   * @dev Change chainId in case of a fork, making sure txs cannot be replayed on forked chains
   * @param _chainId ChainId to be set
   */
  constructor(uint _chainId, address _registry)
    public
    ChainSpecifiable(_chainId)
    RegistryAccessible(_registry)
  {
    DOMAIN_SEPARATOR = keccak256(
      abi.encode(
        keccak256("EIP712Domain(string name,uint256 chainId,address verifyingContract)"),
        keccak256("FansUnite Protocol"),
        _chainId,
        address(this)
      )
    );
  }

  ///////////////////////////////////////////////////////////////////////////////
  ////////////////////////////// External Functions /////////////////////////////
  ///////////////////////////////////////////////////////////////////////////////

  /**
   * @notice Submits a bet
   * @param _subjects Subjects associated with bet [backer, layer, token, league, resolver]
   * @param _params Parameters associated with bet [backerStake, fixture, odds, expiration]
   * @param _nonce Nonce, to ensure hash uniqueness
   * @param _payload Payload for resolver
   * @param _signature ECDSA signature along with the mode
   *  (0 = Typed, 1 = Geth) {mode}{v}{r}{s}.
   */
  function submitBet(
    address[5] _subjects,
    uint[4] _params,
    uint _nonce,
    bytes _payload,
    bytes _signature
  )
    external
  {
    BetLib.Bet memory _bet = BetLib.generate(_subjects, _params, _nonce, _payload);
    bytes32 _hash = BetLib.hash(_bet, DOMAIN_SEPARATOR);

    _authenticateBet(_bet, _hash, _signature);
    _authorizeBet(_bet);
    _validateBet(_bet);
    _processBet(_bet, _hash);

    emit LogBetSubmitted(
      _hash,
      _bet.backer,
      _bet.layer,
      [_bet.token, _bet.league, _bet.resolver],
      [_bet.backerStake, _bet.fixture, _bet.odds, _bet.expiration],
      _nonce,
      _payload
    );
  }

  /**
   * @notice Claims a bet, transfers tokens based on fixture resolution
   * @param _subjects Subjects associated with bet
   * @param _params Parameters associated with bet
   * @param _nonce Nonce, to ensure hash uniqueness
   * @param _payload Payload for resolver
   */
  function claimBet(address[5] _subjects, uint[4] _params, uint _nonce, bytes _payload) external {
    BetLib.Bet memory _bet = BetLib.generate(_subjects, _params, _nonce, _payload);
    bytes32 _hash = BetLib.hash(_bet, DOMAIN_SEPARATOR);

    require(unclaimed[_hash], "Bet with given parameters either claimed or never submitted");

    unclaimed[_hash] = false;
    claimed[_hash] = true;

    uint _result = _processBackerClaim(_bet);

    emit LogBetClaimed(_hash, _result);
  }

  /**
   * @notice Claims a layer's payout
   * @dev Processes funds for layer `msg.sender`
   * @param _league League address
   * @param _resolver Resolver address
   * @param _token Token address
   * @param _fixture Fixture id
   * @param _segment Resolver segment
   */
  function claimPayout(
    address _league,
    address _resolver,
    address _token,
    uint _fixture,
    bytes32 _segment
  )
    external
  {
    // solium-disable-next-line max-len
    bytes32 _hash = PositionLib.getPositionHashRaw(msg.sender, _league, _resolver, _token, _fixture, _segment);
    require(!claimed[_hash], "Cannot re-claim position for given parameters");

    claimed[_hash] = true;

    _processLayerClaim(positions[_hash], _league, _resolver, _token, _fixture);

    emit LogPayoutClaimed(msg.sender, _league, _resolver, _token, _fixture, _segment);
  }

  /**
   * @notice Gets the bet result
   * @param _league Address of league
   * @param _resolver Address of resolver
   * @param _fixture Id of fixture
   * @param _payload Payload for resolver
   * @return uint between 1 and 5 (check IResolver for details) or 0 (for unresolved fixtures)
   */
  function getResult(address _league, address _resolver, uint _fixture, bytes _payload)
    external
    view
    returns (uint)
  {
    return _getResult(_league, _resolver, _fixture, _payload);
  }

  ///////////////////////////////////////////////////////////////////////////////
  ///////////////////////////////// Validate Bet ////////////////////////////////
  ///////////////////////////////////////////////////////////////////////////////

  /**
   * @dev Throws if any of the following checks fail
   *  + `msg.sender` is `_bet.layer`
   *  + `msg.sender` is not `_bet.backer`
   *  + `_bet.backer` has signed `_hash`
   *  + `_hash` is unique (preventing replay attacks)
   * @param _bet Bet to be submitted
   * @param _hash EIP712 complaint hash of _bet
   * @param _signature ECDSA signature along with the mode
   */
  function _authenticateBet(BetLib.Bet memory _bet, bytes32 _hash, bytes _signature)
    private
    view
  {
    require(
      msg.sender == _bet.layer,
      "Bet is not permitted for the msg.sender to take"
    );
    require(
      _bet.backer != address(0) && _bet.backer != msg.sender,
      "Bet is not permitted for the msg.sender to take"
    );
    require(
      !(claimed[_hash] || unclaimed[_hash]),
      "Bet with same hash been submitted before"
    );
    require(
      SignatureLib.isValidSignature(_hash, _bet.backer, _signature),
      "Tx is sent with an invalid signature"
    );
  }

  /**
   * @dev Throws if any of the following checks fail
   *  + `address(this)` is an approved spender by both backer and layer
   *  + `_bet.backer` has appropriate amount staked in vault
   * @param _bet Bet to be authorized
   */
  function _authorizeBet(BetLib.Bet memory _bet) private view {
    IVault _vault = IVault(registry.getAddress("FanVault"));

    require(
      _vault.isApproved(_bet.backer, address(this)),
      "Backer has not approved BetManager to move funds in Vault"
    );
    require(
      _vault.isApproved(_bet.layer, address(this)),
      "Layer has not approved BetManager to move funds in Vault"
    );
    require(
      _vault.balanceOf(_bet.token, _bet.backer) >= _bet.backerStake,
      "Backer does not have sufficient tokens"
    );
  }

  /**
   * @dev Throws if any of the following checks fail
   *  + `_bet.league` is a registered league with FansUnite
   *  + `_bet.resolver` is registered with league
   *  + `_bet.fixture` is scheduled with league
   *  + `_bet.resolver` is not resolved for `_bet.fixture`
   *  + `_bet.backerStake` must belong to set ℝ+
   *  + `_bet.odds` must be greater than 1
   *  + `_bet.expiration` is greater than `now`
   *  + `_bet.payload` is valid according to resolver
   * @param _bet Bet to be validated
   */
  function _validateBet(BetLib.Bet memory _bet) private view {
    address _leagueRegistry = registry.getAddress("LeagueRegistry");
    address _resolverRegistry = registry.getAddress("ResolverRegistry");

    require(
      ILeagueRegistry(_leagueRegistry).isLeagueRegistered(_bet.league),
      "League is not registered with FansUnite"
    );
    require(
      IResolverRegistry(_resolverRegistry).isResolverUsed(_bet.league, _bet.resolver),
      "Resolver is not usable with league"
    );
    require(
      ILeague(_bet.league).isFixtureScheduled(_bet.fixture),
      "Fixture is not scheduled with League"
    );
    require(
      ILeague(_bet.league).isFixtureResolved(_bet.fixture, _bet.resolver) != 1,
      "Fixture is already resolved"
    );
    require(
      _bet.backerStake > 0,
      "Stake does not belong to set ℝ+"
    );
    require(
      _bet.odds > uint(1).mul(10 ** ODDS_DECIMALS),
      "Odds cannot be under 1"
    );
    require(
      _bet.expiration > block.timestamp,
      "Bet has expired"
    );

    __validatePayload(_bet);

  }

  /**
   * @dev Throws if `_payload` is not valid
   * @param _bet Bet instance to be validated
   */
  function __validatePayload(BetLib.Bet memory _bet) private view {
    bool _isPayloadValid;
    address _resolver = _bet.resolver;
    address _league = _bet.league;
    uint256 _fixture = _bet.fixture;
    bytes4 _selector = IResolver(_resolver).getValidatorSelector();
    bytes memory _payload = _bet.payload;

    assembly {
      let _plen := mload(_payload)               // _plen = length of _payload
      let _tlen := add(_plen, 0x44)              // _tlen = total length of calldata
      let _p    := add(_payload, 0x20)           // _p    = encoded bytes of _payload

      let _ptr   := mload(0x40)                  // _ptr   = free memory pointer
      let _index := mload(0x40)                  // _index = same as _ptr
      mstore(0x40, add(_ptr, _tlen))             // update free memory pointer

      mstore(_index, _selector)                  // store selector at _index
      _index := add(_index, 0x04)                // _index = _index + 0x04
      mstore(_index, _league)                    // store address at _index
      _index := add(_index, 0x14)                // _index = _index + 0x14
      _index := add(_index, 0x0C)                // _index = _index + 0x0C
      mstore(_index, _fixture)                   // store _fixture at _index
      _index := add(_index, 0x20)                // _index = _index + 0x20

      for
      { let _end := add(_p, _plen) }             // init: _end = _p + _plen
      lt(_p, _end)                               // cond: _p < _end
      { _p := add(_p, 0x20) }                    // incr: _p = _p + 0x20
      {
        mstore(_index, mload(_p))                // store _p to _index
        _index := add(_index, 0x20)              // _index = _index + 0x20
      }

      let result := staticcall(30000, _resolver, _ptr, _tlen, _ptr, 0x20)

      switch result
      case 0 {
        _isPayloadValid := 0
      }
      default {
        _isPayloadValid := mload(_ptr)
      }
    }

    require(
      _isPayloadValid,
      "Bet payload is not valid"
    );
  }

  ///////////////////////////////////////////////////////////////////////////////
  ///////////////////////////////// Process Bet /////////////////////////////////
  ///////////////////////////////////////////////////////////////////////////////

  /**
   * @dev Processes the funds and stores the bet
   * @param _bet Bet to be processed
   * @param _hash EIP712 complaint hash of _bet
   */
  function _processBet(BetLib.Bet memory _bet, bytes32 _hash) private {
    IVault _vault = IVault(registry.getAddress("FanVault"));

    unclaimed[_hash] = true;

    __processOracleFees(_bet);
    (uint _displacement, bool _increased) = __processPosition(_bet);

    require(
      _vault.transferFrom(_bet.token, _bet.backer, address(this), _bet.backerStake),
      "Cannot transfer backer's stake to pool"
    );

    if (_displacement == 0) return;

    if (_increased) {
      require(
        _vault.transferFrom(_bet.token, _bet.layer, address(this), _displacement),
        "Cannot transfer layer's stake to pool"
      );
    } else {
      require(
        _vault.transfer(_bet.token, _bet.layer, _displacement),
        "Cannot transfer stake from pool"
      );
    }
  }

  /**
   * @dev Processes the oracle fees
   * @param _bet Bet instance
   */
  function __processOracleFees(BetLib.Bet memory _bet) private {
    IVault _vault = IVault(registry.getAddress("FanVault"));
    address _consensusManager = registry.getAddress("ConsensusManager");
    uint _oracleFee = _bet.backerStake.div(ORACLE_FEE);

    require(
      _vault.transferFrom(_bet.token, _bet.layer, _consensusManager, _oracleFee),
      "Cannot transfer oracle fee from layer"
    );
  }

  /**
   * @dev Processes the position of layer `_bet.layer` and returns displacement in position
   * @param _bet Bet to be submitted
   * @return Returns the amount by which the position is displaced after the bet is submitted
   * @return Returns true if risk has increased, false otherwise
   */
  function __processPosition(BetLib.Bet memory _bet) private view returns (uint, bool) {
    PositionLib.Position storage _position = __getPosition(_bet);

    if (_position.volumes[_bet.payload] == 0) {
      require(_position.payloads.length < 3, "Cannot have more than three outcomes");
      _position.payloads.push(_bet.payload);
    }

    uint _o = PositionLib.getExposure(_position);

    uint _layerStake = BetLib.layerStake(_bet, ODDS_DECIMALS);
    _position.payout[_bet.payload] = _position.payout[_bet.payload].add(_layerStake);
    _position.volumes[_bet.payload] = _position.volumes[_bet.payload].add(_bet.backerStake);

    uint _n = PositionLib.getExposure(_position);

    return PositionLib.getNetPayoutDisplacement(_o, _n);
  }


  ///////////////////////////////////////////////////////////////////////////////
  ///////////////////////////// Process Backer Claim ////////////////////////////
  ///////////////////////////////////////////////////////////////////////////////


  /**
   * @dev Processes funds for `_bet.backer` based on result
   * @param _bet Bet to be claimed
   * @return the bet result
   */
  function _processBackerClaim(BetLib.Bet memory _bet) private returns (uint) {
    uint _result = _getResult(_bet.league, _bet.resolver, _bet.fixture, _bet.payload);
    bool _expired = ILeague(_bet.league).getFixtureStart(_bet.fixture) + 7 days <= block.timestamp;
    require(_result > 0 || _expired, "Bet cannot be resolved yet");

    if (_result == 0) __processBackerRevert(_bet);
    else if (_result == 1) __processBackerLose(_bet);
    else if (_result == 2) __processBackerWin(_bet);
    else if (_result == 3) __processBackerHalfLose(_bet);
    else if (_result == 4) __processBackerHalfWin(_bet);
    else if (_result == 5) __processBackerPush(_bet);

    return _result;
  }

  /**
   * @dev Processes the funds back to owners
   * @param _bet Bet to be claimed
   */
  function __processBackerRevert(BetLib.Bet memory _bet) private {
    IVault _vault = IVault(registry.getAddress("FanVault"));

    require(
      _vault.transfer(_bet.token, _bet.backer, _bet.backerStake),
      "Cannot transfer stake from pool"
    );
  }

  /**
   * @dev Processes funds when backer loses
   * @param _bet Bet to be claimed
   */
  function __processBackerLose(BetLib.Bet memory _bet) private {

  }

  /**
   * @dev Processes funds when backer wins
   * @param _bet Bet to be claimed
   */
  function __processBackerWin(BetLib.Bet memory _bet) private {
    IVault _vault = IVault(registry.getAddress("FanVault"));

    uint _layerStake = BetLib.layerStake(_bet, ODDS_DECIMALS);
    uint _totalStake = _bet.backerStake.add(_layerStake);

    require(
      _vault.transfer(_bet.token, _bet.backer, _totalStake),
      "Cannot transfer stake from pool"
    );
  }

  /**
   * @dev Processes funds when backer half loses bet
   * @param _bet Bet to be claimed
   */
  function __processBackerHalfLose(BetLib.Bet memory _bet) private {
    IVault _vault = IVault(registry.getAddress("FanVault"));

    uint _backerReturn = _bet.backerStake.div(2);

    require(
      _vault.transfer(_bet.token, _bet.backer, _backerReturn),
      "Cannot transfer stake from pool"
    );
  }

  /**
   * @dev Processes funds when backer half wins bet
   * @param _bet Bet to be claimed
   */
  function __processBackerHalfWin(BetLib.Bet memory _bet) private {
    IVault _vault = IVault(registry.getAddress("FanVault"));

    uint _layerStake = BetLib.layerStake(_bet, ODDS_DECIMALS);
    uint _layerReturn = _layerStake.div(2);
    uint _backerReturn = _bet.backerStake.add(_layerReturn);

    require(
      _vault.transfer(_bet.token, _bet.backer, _backerReturn),
      "Cannot transfer stake from pool"
    );
  }

  /**
   * @dev Processes funds when bet results in push
   * @param _bet Bet to be claimed
   */
  function __processBackerPush(BetLib.Bet memory _bet) private {
    IVault _vault = IVault(registry.getAddress("FanVault"));

    require(
      _vault.transfer(_bet.token, _bet.backer, _bet.backerStake),
      "Cannot transfer stake from pool"
    );
  }


  ///////////////////////////////////////////////////////////////////////////////
  ///////////////////////////// Process Layer Claim /////////////////////////////
  ///////////////////////////////////////////////////////////////////////////////

  /**
   * @dev Processes funds for layer `msg.sender`
   * @param _position Layer's position
   * @param _league League address
   * @param _resolver Resolver address
   * @param _token Token address
   * @param _fixture Fixture id
   */
  function _processLayerClaim(
    PositionLib.Position storage _position,
    address _league,
    address _resolver,
    address _token,
    uint _fixture
  )
    private
  {
    require(_position.payloads.length > 0, "No bets recorded for given position");

    IVault _vault = IVault(registry.getAddress("FanVault"));
    uint _net = _getLayerPayout(_position, _league, _resolver, _fixture);

    if (_net == 0) return;

    require(
      _vault.transfer(_token, msg.sender, _net),
      "Cannot transfer layer stake from pool"
    );
  }

  /**
   * @dev Gets net payout for layer `msg.sender`
   * @param _position Layer's position
   * @param _league League address
   * @param _resolver Resolver address
   * @param _fixture Fixture id
   */
  function _getLayerPayout(
    PositionLib.Position storage _position,
    address _league,
    address _resolver,
    uint _fixture
  )
    private
    returns (uint)
  {
    uint _payout;
    uint _gain;
    uint _e = PositionLib.getExposure(_position);

    for (uint _i = 0; _i < _position.payloads.length; _i++) {
      uint _result = _getResult(_league, _resolver, _fixture, _position.payloads[_i]);

      if (_result == 0) {  // No resolution
        bool _expired = ILeague(_league).getFixtureStart(_fixture) + 7 days <= block.timestamp;
        require(_expired, "Claim cannot be resolved yet");

        _gain = _e;
        _payout = 0;
        break;

      } else if (_result == 1) {  // Lose
        _gain = _gain.add(_position.volumes[_position.payloads[_i]]);

      } else if (_result == 2) {  // Win
        _payout = _position.payout[_position.payloads[_i]];

      } else if (_result == 3) {  // HL
        _gain = _position.volumes[_position.payloads[_i]].div(2);

      } else if (_result == 4) {  // HW
        _payout = _position.payout[_position.payloads[_i]].div(2);

      } else if (_result == 5) {  // Push
        _gain = _e;
        _payout = 0;
        break;
      }
    }

    if (_payout > _gain) {
      return _e.sub(_payout.sub(_gain));
    } else {
      return _e.add(_gain.sub(_payout));
    }
  }

  ///////////////////////////////////////////////////////////////////////////////
  /////////////////////////////////// Utility ///////////////////////////////////
  ///////////////////////////////////////////////////////////////////////////////

  /**
   * @dev Gets Position of the layer for the generic set that _bet belongs in
   * @param _bet Bet instance
   */
  function __getPosition(BetLib.Bet memory _bet)
    private
    returns (PositionLib.Position storage _position)
  {
    bytes32 _seg = __getPositionSegment(_bet.league, _bet.resolver, _bet.fixture, _bet.payload);
    bytes32 _hash = PositionLib.getPositionHashRaw(
      _bet.layer,
      _bet.league,
      _bet.resolver,
      _bet.token,
      _bet.fixture,
      _seg
    );

    _position = positions[_hash];
  }

  /**
   * @notice Gets the bet result
   * @param _league Address of league
   * @param _resolver Address of resolver
   * @param _fixture Id of fixture
   * @param _payload Payload for resolver
   * @return uint between 1 and 5 (check IResolver for details) or 0 (for unresolved fixtures)
   */
  function _getResult(address _league, address _resolver, uint _fixture, bytes _payload)
    private
    view
    returns (uint)
  {
    if (ILeague(_league).isFixtureResolved(_fixture, _resolver) != 1) return 0;

    bytes memory _resolution = ILeague(_league).getResolution(_fixture, _resolver);
    return __getResult(_league, _resolver, _fixture, _payload, _resolution);
  }

  /**
   * @dev Gets the bet result based on arguments
   * @dev Throws if call to resolver fails
   * @param __league Address of league
   * @param __resolver Address of resolver
   * @param __fixture Id of fixture
   * @param __payload bet payload encoded function parameters
   * @param __resolution resolution encoded function parameters
   * @return uint between 1 and 5 (check IResolver for details)
   */
  function __getResult(
    address __league,
    address __resolver,
    uint __fixture,
    bytes __payload,
    bytes memory __resolution
  )
    private
    view
    returns (uint)
  {
    uint _result;
    address _resolver = __resolver;
    bytes4 _selector = IResolver(_resolver).getInitSelector();
    address _league = __league;
    uint256 _fixture = __fixture;
    bytes memory _payload = __payload;

    assembly {
      let _plen := mload(_payload)               // _plen = length of _payload
      let _rlen := mload(__resolution)            // _rlen = length of _resolution
      let _tlen := add(_rlen, add(_plen, 0x44))  // _tlen = total length of calldata
      let _p    := add(_payload, 0x20)           // _p    = encoded bytes of _payload
      let _r    := add(__resolution, 0x20)        // _r    = encoded bytes of _resolution

      let _ptr   := mload(0x40)                  // _ptr   = free memory pointer
      let _index := mload(0x40)                  // _index = same as _ptr
      mstore(0x40, add(_ptr, _tlen))             // update free memory pointer

      mstore(_index, _selector)                  // store selector at _index
      _index := add(_index, 0x04)                // _index = _index + 0x04
      mstore(_index, _league)                    // store address at _index
      _index := add(_index, 0x14)                // _index = _index + 0x14
      _index := add(_index, 0x0C)                // _index = _index + 0x0C
      mstore(_index, _fixture)                   // store _fixture at _index
      _index := add(_index, 0x20)                // _index = _index + 0x20

      for
      { let _end := add(_p, _plen) }             // init: _end = _p + _plen
      lt(_p, _end)                               // cond: _p < _end
      { _p := add(_p, 0x20) }                    // incr: _p = _p + 0x20
      {
        mstore(_index, mload(_p))                // store _p to _index
        _index := add(_index, 0x20)              // _index = _index + 0x20
      }

      for
      { let _end := add(_r, _rlen) }             // init: _end = _r + _rlen
      lt(_r, _end)                               // cond: _r < _end
      { _r := add(_r, 0x20) }                    // incr: _r = _r + 0x20
      {
        mstore(_index, mload(_r))                // store _r to _index
        _index := add(_index, 0x20)              // _index = _index + 0x20
      }

      let result := staticcall(30000, _resolver, _ptr, _tlen, _ptr, 0x20)

      switch result
      case 0 {
        _result := 0
      }
      default {
        _result := mload(_ptr)
      }
    }

    require(_result != 0, "Call to resolver failed");

    return _result;
  }

  /**
   * @dev Throws if `_payload` is not valid
   * @param __league league address
   * @param __resolver resolver address
   * @param __fixture fixture id
   * @param _payload bet payload
   */
  function __getPositionSegment(
    address __league,
    address __resolver,
    uint __fixture,
    bytes memory _payload
  )
    private
    view
    returns (bytes32)
